// Twitter module
(function(e,t){String.prototype.parseTwitterURL=function(){return this.replace(/[A-Za-z]+:\/\/[A-Za-z0-9-_]+\.[A-Za-z0-9-_:%&~\?\/.=]+/g,function(e){return e.link(e)})};String.prototype.parseTwitterUsername=function(){return this.replace(/[@]+[A-Za-z0-9-_]+/g,function(e){var t=e.replace("@","");return e.link("http://twitter.com/"+t)})};String.prototype.parseTwitterHashtag=function(){return this.replace(/[#]+[A-Za-z0-9-_]+/g,function(e){var t=e.replace("#","%23");return e.link("http://twitter.com/search?q="+t)})};t.TwitterModule=e.Modules.extend({url:function(){return"http://troysabin.azurewebsites.net/?count="+(this.ident||10)},orderBy:function(e){return-(new Date(e.created_at)).getTime()},render:function(e){var t="<p>"+e.text+"</p>";t='<div class="socialfeed-item socialfeed-twitter"><i class="socialfeed-icon icon-twitter"></i>'+t+"</div>";return t.parseTwitterURL().parseTwitterUsername().parseTwitterHashtag()}})})(SocialFeed,window);